import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { SpaceXService } from '../services/space-x.service';

@Component({
  selector: 'app-missiondetails',
  templateUrl: './missiondetails.component.html',
  styleUrls: ['./missiondetails.component.scss']
})
export class MissiondetailsComponent implements OnInit {
  flight_number: string = '';
  mission: any = {};

  constructor(private route: ActivatedRoute, private spaceXService: SpaceXService) { }

  ngOnInit(): void {
    this.route.paramMap.subscribe(params => {
      this.flight_number = params.get('id') || '';
      console.log('Flight Number:', this.flight_number);
      if (this.flight_number) {
        this.spaceXService.getLaunchByFlightNumber(this.flight_number).subscribe(data => {
          this.mission = data;
        });
      }
    });
  }

}
